import React from "react";
import "./contact.style.css";
function ContactPage() {
  return (
    <center>
      <iframe
        className="iframe"
        scrolling="no"
        title="Contact"
        src="https://docs.google.com/forms/d/e/1FAIpQLScV1lBdUWjz12stzozHYYTdb7Kv3698odggzG9O3QlEDoTsEQ/viewform?embedded=true"
        width="640"
        height="911"
        frameborder="0"
        marginheight="0"
        marginwidth="0"
      >
        Contact
      </iframe>
    </center>
  );
}

export default ContactPage;
